webpackJsonp([0xc3cf686afac5],{275:function(e,a){e.exports={data:{allPosts:{edges:[{node:{id:"606132",title:"How a factory worker’s son turned Tokopedia into a giant (infographic)",excerpt:"A look back at the founder’s humble beginnings in a North Sumatra town to the SoftBank- and Alibaba-backed behemoth Tokopedia has become.",featured_image:"https://cdn.techinasia.com/wp-content/uploads/2018/12/Tokopedia-Round-up-02.png",date_gmt:"2018-12-20T05:00:46",category:"e-commerce-social-commerce",content:'<p>With a <a href="https://www.techinasia.com/tokopedia-raises-11b-softbank-alibaba">US$1.1 billion funding round</a>, Tokopedia has cemented its position as Indonesia’s most valuable startup. Now, it’s setting its sights beyond ecommerce.</p>\n<p>Tokopedia co-founder and CEO William Tanuwijaya likens his company to a “magic Doraemon pocket” – referring to the Japanese manga series that’s popular throughout Asia – through which consumers can get anything they want, anywhere they are at an instant. After nine years catering to online consumers, the next step is to go offline.</p>\n<p>“Imagine if we can give this ‘magic Doraemon pocket’ to offline businesses – small kiosks, mom-and-pop stores, farmers, fishermen, local makers – and enable them to improve their margins, restock their inventories faster, get access to financial services and capital, and increase their distribution efficiency,” Tanuwijaya said in an email.</p>\n<p>“If we can do all of that, we will be one step closer to our mission to democratize commerce – both online and offline – through technology,” he added.</p>\n<p>As the company celebrates its ninth anniversary, here’s a look back at the Tokopedia story – from its founder’s humble beginnings in a North Sumatra town to the SoftBank- and Alibaba-backed behemoth it has become.</p>\n<p><img class="aligncenter size-full wp-image-606133" src="https://cdn.techinasia.com/wp-content/uploads/2018/12/Tokopedia-Round-up-01.png" alt="" width="731" height="10008"></p>'}}]}},pathContext:{slug:"9-years-tokopedia"}}}});
